import React, { Component } from 'react'

export default class Edits extends Component {
    render() {
        return (
            <div className="container">
                <div className="Panel-block is-primary is-centered columns">
                    <div className="column is-one-forth">

                        <span className="button is-medium is-danger is-narrow">
                            <i className="fa fa-trash"></i>
                        </span>
                        <span className="button is-medium is-success is-narrow">
                            <i class="fa fa-plus"></i>
                        </span>
                    </div>
                </div>
            </div>
        )
    }
}
